import React, { Component } from 'react'

class startForm extends Component {
    render() {
        return (

            <div className="root-container">
            <div className="box-controller">
              <div className="controller">
                Login
              </div>
              <div className="controller">
                Register
              </div>
            </div>
              <div className="box-container">

              
              </div>
            </div>
        )
    }
}

export default startForm;
